import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const About = () => {
  return (
    <section id="about-us">
      <Container
        fluid
        style={{
          paddingTop: "5rem",
          backgroundColor: "#EBBFF3",
          width: 1577,
          height: 700,
          textAlign: "center",
          fontFamily: "primary-font",
        }}
      >
        <h1 style={{ fontSize: 55 }}>Designers.Developers.Nuubs.</h1>
        <p
          style={{
            fontSize: 25,
            width: "70%",
            marginTop: "2rem",
            marginLeft: "13rem",
            fontFamily: "secondary-font",
          }}
        >
          This is us. Everyday, we are proud of our profession, training and
          experience behind us, always ready to deliver the best of your
          product!
        </p>
        <Row
          style={{
            marginTop: "7rem",
            marginLeft: "11rem",
          }}
        >
          <Col md={4}>
            <div
              style={{
                width: 250,
                height: 250,
                borderRadius: "50%",
                backgroundColor: "whitesmoke",
              }}
            />
          </Col>
          <Col md={4}>
            <div
              style={{
                width: 250,
                height: 250,
                borderRadius: "50%",
                backgroundColor: "whitesmoke",
              }}
            />
          </Col>
          <Col md={4}>
            <div
              style={{
                width: 250,
                height: 250,
                borderRadius: "50%",
                backgroundColor: "whitesmoke",
              }}
            />
          </Col>
          <Col md={4}>
            <div
              style={{
                width: 250,
                height: 250,
                borderRadius: "50%",
                backgroundColor: "whitesmoke",
              }}
            />
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default About;
